// HomePage.js
import React from 'react';
import videoBg from "./components/background.mp4";
import yourSvg from './components/HomePage.svg';

const HomePage = () => {
  return (
    <div style={{ position: 'relative', width: '100vw', height: '100vh', overflow: 'hidden' }}>
      {/* Video */}
      <video autoPlay loop muted playsInline style={{ position: 'absolute', top: 0, left: 0, width: '100%', height: '100%', objectFit: 'cover' }}>
        <source src={videoBg} type="video/mp4"></source>
      </video>

      {/* SVG */}
      <img src={yourSvg} alt="Your SVG" style={{ position: 'absolute', top: 0, left: 0, width: '100%', height: '100%', objectFit: 'cover' }} />
    </div>
  );
};

export default HomePage;
